import "./project.css";
import ProjectData from "./ProjectData";
import { useState } from "react";
import { ArrowDownward } from "@material-ui/icons";

function Project() {
  const [btnActive1, setBtnActive1] = useState("active");
  const [btnActive2, setBtnActive2] = useState("");
  const [btnActive3, setBtnActive3] = useState("");
  const [btnActive4, setBtnActive4] = useState("");
  const [btnActive5, setBtnActive5] = useState("");

  const data = [
    {
      id: 1,
      uniqueData: "django",
      headerTitle: "Student Management System (PHP, Mysql)",
      tooTipTitle: "Student Management System",
      imgUrl: "assets/images/n1.jpg",
      projectText:
      "The project is based on Student Management system. It helps to check Admin Panel everything about students and maintain and also Student can see their details by entering roll no.",
    },
    {
      id: 2,
      uniqueData: "django",
      headerTitle: "Gym Management System (Python, Django)",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "The Project is a software designed to help the gym to keep the track of the day to day activities which take place in the gym. Project deals with an online system designed for management of customers,enquiries, and equipments, payment etc.",
    },
    {
      id: 9,
      uniqueData: "other",
      headerTitle: "Note Taker (Java Servlet,JSP,Hibernate)",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "This project is documentation based that Can store Information and perform CRUD operations.",
    },
    {
      id: 3,
      uniqueData: "other",
      headerTitle: "Project Title3",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "Project Decription",
    },
    {
      id: 4,
      uniqueData: "other",
      headerTitle: "Project Title4",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "Project Decription",
    },
    {
      id: 5,
      uniqueData: "other",
      headerTitle: "Project Title5",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "Project Decription",
    },
    {
      id: 2,
      uniqueData: "drf",
      headerTitle: "Tip Calculator (HTML,CSS,Javascript)",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "The project is based on Calculate the Tip for each Employees.",
    },
    {
      id: 2,
      uniqueData: "react",
      headerTitle: "Game (HTML, CSS, Javascript)",
      tooTipTitle: "Tool tip Title",
      imgUrl: "assets/images/n1.jpg",
      projectText: "This is an animation based Game, in this Game have two Animals Cat and Dog that Cat is jump to save from Dog.",
    },
  ];

  const [myID, setMyID] = useState("all");

  var filterDataHandler1 = () => {
    setBtnActive1("active");
    setBtnActive2("");
    setBtnActive3("");
    setBtnActive4("");
    setBtnActive5("");

    setMyID("all");
  };
  var filterDataHandler2 = () => {
    setBtnActive2("active");
    setBtnActive1("");
    setBtnActive3("");
    setBtnActive4("");
    setBtnActive5("");

    setMyID("django");
  };
  var filterDataHandler3 = () => {
    setBtnActive3("active");
    setBtnActive2("");
    setBtnActive1("");
    setBtnActive4("");
    setBtnActive5("");

    setMyID("drf");
  };
  var filterDataHandler4 = () => {
    setBtnActive4("active");
    setBtnActive2("");
    setBtnActive3("");
    setBtnActive1("");
    setBtnActive5("");

    setMyID("react");
  };
  var filterDataHandler5 = () => {
    setBtnActive5("active");
    setBtnActive2("");
    setBtnActive3("");
    setBtnActive4("");
    setBtnActive1("");

    setMyID("other");
  };

  return (
    <div className="container" style={{ marginTop: "60px" }}>
      <p className="text-center contText">Our Works</p>
      <br />
      <p className="contp">
        Here my project works{" "}
        <ArrowDownward />
      </p>
      <br />
      <div className="myBtnContainer text-center">
        <button
          className={`btn p-2 m-4 filterBtn ${btnActive1}`}
          onClick={filterDataHandler1}
        >
          {" "}
          Show all
        </button>
        <button
          className={`btn p-2 m-4 filterBtn ${btnActive2}`}
          onClick={filterDataHandler2}
        >
          {" "}
          Django
        </button>
        <button
          className={`btn p-2 m-4 filterBtn ${btnActive3}`}
          onClick={filterDataHandler3}
        >
          {" "}
          Django Rest API
        </button>
        <button
          className={`btn p-2 m-4 filterBtn ${btnActive4}`}
          onClick={filterDataHandler4}
        >
          {" "}
          React JS
        </button>
        <button
          className={`btn p-2 m-4 filterBtn ${btnActive5}`}
          onClick={filterDataHandler5}
        >
          {" "}
          Others
        </button>
      </div>

      <div className="row mt-5 text-center projectItems">
        {
          data
            .filter((items) => items.uniqueData === myID)

            .map((item) => (
              <ProjectData data={item} key={item.id} />
            ))


          // data.map((dataDetails) => {

          //     return(

          //         <ProjectData data={dataDetails} key={dataDetails.id}/>
          //     )
          // })
        }
        {
          data
            .filter((items) => items.uniqueData !== myID)

            .map((item) => (
              <ProjectData data={item} key={item.id} />
            ))
        }
      </div>
    </div>
  );
}

export default Project;
